import NavBar from "@components/navBar"
import Header from "./component/header"
import Weal from "./component/weal"
import React, { useEffect } from "react"
import { queryActivityTypes } from "@pages/activity/request"
import { getlist } from "./request"
import './style.scss'
import { useState } from "react"

const Message = () => {
 const [type, setType] = useState(1);
 const [wealList, setWealList] = useState([])
 const [activityTypes, setActivityTypes] = useState([])
 useEffect(() => {
  queryActivityTypes().then((res) => {
   setActivityTypes(res.data)
   getlist().then(res => {
    setWealList(res.data)
   })
  })
 }, [])
 return (
  <div className="message">
   <Header changeTab={setType} type={type} />
   <div className="weal-container">
    {wealList.map((weal: any, index) => <Weal key={weal.id} data={weal} activityTypes={activityTypes} />)}
   </div>
   <NavBar />
  </div>
 )
}
export default Message;
